.g-main-nav__link {
  display: block;
  margin-right: 0em;
  margin-left: -0.9em;
  font-family: sans-serif;
  font-size: 18px;
  color: #ffffff;
  letter-spacing: 0;
  line-height: 20px;
}

.g-main-nav__link__a {
  display: block;
  padding: 1em;
  color: #ffffff;
  text-decoration: none;
}

.g-main-nav__link__a:hover {
  text-decoration: underline;
}

.g-main-nav__link__a--active {
  border-left: solid 0.2em #24a882;
  padding-left: 0.8em;
}

.g-main-nav__link__a:focus {
  outline: 3px solid #b53cde;
}

@media only screen and (min-width: 48em) {
  .g-main-nav__link {
    display: inline-block;
    margin-right: 1em;
    margin-left: 0px;
    margin-top: 4px; /* on Desktop we wrap links, so when they're on 2+ lines we need a margin to separate (1) active underline from (2) focus outline */
  }

  .g-main-nav__link:first-child {
    margin-left: 0em;
  }

  .g-main-nav__link:last-child {
    margin-right: 0px;
  }

  .g-main-nav__link__a {
    position: relative;
    display: inline-block;
    padding: 0.6em 1em;
  }

  .g-main-nav__link__a--active {
    border-left: none;
  }

  .g-main-nav__link__a--active::after {
    content: '';
    position: absolute;
    clear: both;
    display: block;
    bottom: 0px;
    left: 1em;
    right: 1em;
    height: 4px;
    background: #24a882;
  }
}

MainNav.css:
.g-main-nav {
  display: block;
  padding: 0px;
  margin: 0px;
  background-color: #2a2a2a;
}

.g-flex-container .g-main-nav,
.g-flex-container-fluid .g-main-nav {
  margin: 0px -1rem;
}

@media only screen and (min-width: 48em) {
  .g-main-nav {
    margin: 0px;
    background-color: transparent;
  }

  .g-flex-container .g-main-nav,
  .g-flex-container-fluid .g-main-nav {
    margin: 0px -2rem;
  }
}

.g-main-nav__button {
  position: absolute;
  top: 3px;
  right: 3px;
  background: transparent;
  color: #ffffff;
  font-size: 16px;
  display: none; /* Because the menu requires JavaScript this button is hidden by default and revealed in JS */
  padding: 1em;
  border: none;
}

.g-main-nav__button.g-main-nav--open,
.g-main-nav__button.g-main-nav--closed {
  display: inline-block;
}

@media only screen and (min-width: 48em) {
  /* don't show on larger responsive */
  .g-main-nav__button.g-main-nav--open,
  .g-main-nav__button.g-main-nav--closed {
    display: none;
  }
}

.g-main-nav__button:focus {
  outline: 3px solid #b53cde;
}

.g-main-nav__button__icon {
  display: inline-block;
  color: #24a882;
  transition: transform 0.15s;
  vertical-align: middle;
  margin-left: 0.2em;
  width: 12px;
  height: 12px;
  transform: rotate(180deg);
}

.g-main-nav__button.g-main-nav--closed > .g-main-nav__button__icon {
  transform: rotate(0deg);
}

.g-main-nav__ul {
  list-style: none;
  padding: 0px;
  margin: 0px 0px 0px 1rem;
}

.g-main-nav__ul.g-main-nav--open {
  display: block;
}

.g-main-nav__ul.g-main-nav--closed {
  display: none;
}

@media only screen and (min-width: 48em) {
  .g-main-nav__ul {
    margin: -4px 2rem 0px 2rem;
  }

  /* on desktop screens it can't be closed */
  .g-main-nav__ul.g-main-nav--closed {
    display: block;
  }
}

